import './App.css';
import { useState, useEffect } from 'react';
import  Axios  from 'axios';

function App() {
  const [movieList, setMovieList] = useState([]);

  useEffect(() => {
    Axios.get("http://localhost:8000/api/getMovies").then((response) => {
      setMovieList(response.data);
    });
  }, []);

  return (
    <div className="App">
      <div>
        {movieList.map((movie) => {
          return (
            <>
            <h1>{movie.title}</h1>
            <h1>{movie.actors}</h1>
           </>
          )
        })}

      </div>
    </div>
  );
}

export default App;
